**Describe the bug**
`define_static_array` and `define_static_string` were removed in P2996R8, but are still present in the implementation. I guess this is because `nonstatic_data_members` and friends don't yield `constexpr`?

```
#include <experimental/meta>

template<typename T>
consteval auto test() {
  constexpr auto ctx = std::meta::access_context::current();

  // fails to compile
  template for (constexpr auto mm : nonstatic_data_members_of(^^T, ctx)) {}

  // compiles (but shouldn't, I believe)
  template for (constexpr auto mm : define_static_array(nonstatic_data_members_of(^^T, ctx))) {}
}

struct X {};
consteval {
test<X>();
}

int main() {}
```

See https://godbolt.org/z/eYfj8MvWo

In that context, `define_static_array` is also still used in P2996R13 in a couple of examples. What is the best way to report issues like that?

Thanks for your hard work on this! I truly appreciate it!

